import React, { Component } from 'react';
import { robots } from './robots';
import CardList from './CardList';
import SearchBox from './SearchBox';

class app extends Component {
  render() {
    <div className="tc">
      <h1>Robofriends</h1>
      <SearchBox />
      <CardList robots={robots} />;
    </div>;
  }
}

export default App;
